  return "<dataConfig>\r\n" + "  <document>\r\n"
      + "    <entity name='se' processor='SolrEntityProcessor'" + "   url='"
      + (useFakeUrl ? "http://[ff01::114]:33332/solr" : getSourceUrl()) + "' " + options + " />\r\n" + "  </document>\r\n"
      + "</dataConfig>\r\n";
}

